import React from 'react';
import './TodoList.css';

const TodoItem = ({item}) => {
    return (
        <div>{item.id}. {item.content}</div>
    )
}

const TodoList = ({}) => {
        const {todoList, TodoActions, input} = this.props
        const todoItems = todoList.map(item => <TodoItem item={item} key={item.id}/>)

        return (
            <div>
                {todoItems}
            </div>
        )
}

export default TodoList;
